043a\u0430 <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1099_%D0%B3%D0%BE%D0%B4\" title=\"1099 \u0433\u043e\u0434\">1099<\/a>&#160;\u2014 \u0432\u0437\u044f\u0442\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B5%D1%80%D1%83%D1%81%D0%B0%D0%BB%D0%B8%D0%BC\" title=\"\u0418\u0435\u0440\u0443\u0441\u0430\u043b\u0438\u043c\">\u0418\u0435\u0440\u0443\u0441\u0430\u043b\u0438\u043c\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B5%D1%81%D1%82%D0%BE%D0%B2%D1%8B%D0%B5_%D0%BF%D0%BE%D1%85%D0%BE%D0%B4%D1%8B\" title=\"\u041a\u0440\u0435\u0441\u0442\u043e\u0432\u044b\u0435 \u043f\u043e\u0445\u043e\u0434\u044b\">\u043a\u0440\u0435\u0441\u0442\u043e\u043d\u043e\u0441\u0446\u0430\u043c\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1205_%D0%B3%D0%BE%D0%B4\" title=\"1205 \u0433\u043e\u0434\">1205<\/a>&#160;\u2014 \u041f\u0430\u043f\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D0%BD%D0%BE%D0%BA%D0%B5%D0%BD%D1%82%D0%B8%D0%B9_III\" title=\"\u0418\u043d\u043d\u043e\u043a\u0435\u043d\u0442\u0438\u0439 III\">\u0418\u043d\u043d\u043e\u043a\u0435\u043d\u0442\u0438\u0439 III<\/a> \u0437\u0430\u044f\u0432\u0438\u043b, \u0447\u0442\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B2%D1%80%D0%B5%D0%B8\" title=\"\u0415\u0432\u0440\u0435\u0438\">\u0435\u0432\u0440\u0435\u0438<\/a> \u043e\u0431\u0440\u0435\u0447\u0435\u043d\u044b \u043d\u0430 \u0432\u0435\u0447\u043d\u043e\u0435 \u0440\u0430\u0431\u0441\u0442\u0432\u043e \u0438 \u043f\u043e\u043a\u043e\u0440\u0435\u043d\u0438\u0435 \u0438\u0437-\u0437\u0430 \u0440\u0430\u0441\u043f\u044f\u0442\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B8%D1%81%D1%83%D1%81_%D0%A5%D1%80%D0%B8%D1%81%D1%82%D0%BE%D1%81\" title=\"\u0418\u0438\u0441\u0443\u0441 \u0425\u0440\u0438\u0441\u0442\u043e\u0441\">\u0418\u0438\u0441\u0443\u0441\u0430 \u0425\u0440\u0438\u0441\u0442\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1228_%D0%B3%D0%BE%D0%B4\" title=\"1228 \u0433\u043e\u0434\">1228<\/a>&#160;\u2014 \u0441\u043f\u0443\u0441\u0442\u044f \u0434\u0432\u0430 \u0433\u043e\u0434\u0430 \u043f\u043e\u0441\u043b\u0435 \u0441\u043c\u0435\u0440\u0442\u0438 \u043e\u0441\u043d\u043e\u0432\u0430\u0442\u0435\u043b\u044c \u043e\u0440\u0434\u0435\u043d\u0430 \u0444\u0440\u0430\u043d\u0446\u0438\u0441\u043a\u0430\u043d\u0446\u0435\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%81%D0%BA_%D0%90%D1%81%D1%81%D0%B8%D0%B7%D1%81%D0%BA%D0%B8%D0%B9\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u0441\u043a \u0410\u0441\u0441\u0438\u0437\u0441\u043a\u0438\u0439\">\u0424\u0440\u0430\u043d\u0446\u0438\u0441\u043a \u0410\u0441\u0441\u0438\u0437\u0441\u043a\u0438\u0439<\/a> \u043f\u0440\u0438\u0447\u0438\u0441\u043b\u0435\u043d \u043a \u043b\u0438\u043a\u0443 \u0441\u0432\u044f\u0442\u044b\u0445 \u043f\u0430\u043f\u043e\u0439 \u0440\u0438\u043c\u0441\u043a\u0438\u043c \u0413\u0440\u0438\u0433\u043e\u0440\u0438\u0435\u043c IX.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1240_%D0%B3%D0%BE%D0%B4\" title=\"1240 \u0433\u043e\u0434\">1240<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%AF%D1%80%D0%BE%D1%81%D0%BB%D0%B0%D0%B2%D0%B8%D1%87_%D0%9D%D0%B5%D0%B2%D1%81%D0%BA%D0%B8%D0%B9\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u042f\u0440\u043e\u0441\u043b\u0430\u0432\u0438\u0447 \u041d\u0435\u0432\u0441\u043a\u0438\u0439\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u041d\u0435\u0432\u0441\u043a\u0438\u0439<\/a> \u0441\u043e \u0441\u0432\u043e\u0438\u043c \u0432\u043e\u0439\u0441\u043a\u043e\u043c \u0430\u0442\u0430\u043a\u043e\u0432\u0430\u043b \u0432\u043e\u0435\u043d\u043d\u044b\u0439 \u043b\u0430\u0433\u0435\u0440\u044c \u0448\u0432\u0435\u0434\u043e\u0432 \u043d\u0430 \u041d\u0435\u0432\u0435 \u0438 \u043d\u0430\u043d\u0451\u0441 \u0438\u043c \u043f\u043e\u043b\u043d\u043e\u0435 \u043f\u043e\u0440\u0430\u0436\u0435\u043d\u0438\u0435 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%B1%D0%B8%D1%82%D0%B2%D0%B0\" title=\"\u041d\u0435\u0432\u0441\u043a\u0430\u044f \u0431\u0438\u0442\u0432\u0430\">\u041d\u0435\u0432\u0441\u043a\u0430\u044f \u0431\u0438\u0442\u0432\u0430<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1381_%D0%B3%D0%BE%D0%B4\" title=\"1381 \u0433\u043e\u0434\">1381<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%BD%D1%82-%D0%9E%D0%BB%D0%B1%D0%B0%D0%BD%D1%81_(%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F)\" title=\"\u0421\u0435\u043d\u0442-\u041e\u043b\u0431\u0430\u043d\u0441 (\u0410\u043d\u0433\u043b\u0438\u044f)\">\u0421\u0435\u043d\u0442-\u041e\u043b\u0431\u0430\u043d\u0441\u0435<\/a> \u043f\u043e\u0432\u0435\u0448\u0435\u043d \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0439 \u043f\u0440\u043e\u043f\u043e\u0432\u0435\u0434\u043d\u0438\u043a, \u0438\u0434\u0435\u043e\u043b\u043e\u0433 \u0435\u0440\u0435\u0441\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BB%D0%BB%D0%B0%D1%80%D0%B4%D1%8B\" title=\"\u041b\u043e\u043b\u043b\u0430\u0440\u0434\u044b\">\u043b\u043e\u043b\u043b\u0430\u0440\u0434\u043e\u0432<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D0%BB,_%D0%94%D0%B6%D0%BE%D0%BD_(%D1%81%D0%B2%D1%8F%D1%89%D0%B5%D0%BD%D0%BD%D0%B8%D0%BA)\" title=\"\u0411\u043e\u043b\u043b, \u0414\u0436\u043e\u043d (\u0441\u0432\u044f\u0449\u0435\u043d\u043d\u0438\u043a)\">\u0414\u0436\u043e\u043d \u0411\u043e\u043b\u043b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1410_%D0%B3%D0%BE%D0%B4\" title=\"1410 \u0433\u043e\u0434\">1410<\/a>&#160;\u2014 \u043f\u043e\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u0432\u043e\u0439\u0441\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D0%B2%D1%82%D0%BE%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BE%D1%80%D0%B4%D0%B5%D0%BD\" title=\"\u0422\u0435\u0432\u0442\u043e\u043d\u0441\u043a\u0438\u0439 \u043e\u0440\u0434\u0435\u043d\">\u0422\u0435\u0432\u0442\u043e\u043d\u0441\u043a\u043e\u0433\u043e \u043e\u0440\u0434\u0435\u043d\u0430<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D1%8E%D0%BD%D0%B2%D0%B0%D0%BB%D1%8C%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%B1%D0%B8%D1%82%D0%B2%D0%B0\" title=\"\u0413\u0440\u044e\u043d\u0432\u0430\u043b\u044c\u0434\u0441\u043a\u0430\u044f \u0431\u0438\u0442\u0432\u0430\">\u0413\u0440\u044e\u043d\u0432\u0430\u043b\u044c\u0434\u0441\u043a\u043e\u043c \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0438<\/a> \u043e\u0442 \u043b\u0438\u0442\u043e\u0432\u0441\u043a\u0438\u0445 \u0438 \u043f\u043e\u043b\u044c\u0441\u043a\u0438\u0445 \u0432\u043e\u0439\u0441\u043a, \u043e\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0432\u0448\u0435\u0435 \u044d\u043a\u0441\u043f\u0430\u043d\u0441\u0438\u044e \u043e\u0440\u0434\u0435\u043d\u0430 \u043d\u0430 \u0437\u0435\u043c\u043b\u0438 \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043a\u043d\u044f\u0436\u0435\u0441\u0442\u0432\u0430 \u041b\u0438\u0442\u043e\u0432\u0441\u043a\u043e\u0433\u043e \u0438 \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u0430 \u041f\u043e\u043b\u044c\u0441\u043a\u043e\u0433\u043e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1525_%D0%B3%D0%BE%D0%B4\" title=\"1525 \u0433\u043e\u0434\">1525<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BE%D0%B0%D1%85%D0%B8%D0%BC_I_%D0%9D%D0%B5%D1%81%D1%82%D0%BE%D1%80\" title=\"\u0418\u043e\u0430\u0445\u0438\u043c I \u041d\u0435\u0441\u0442\u043e\u0440\">\u043a\u0443\u0440\u0444\u044e\u0440\u0441\u0442 \u0411\u0440\u0430\u043d\u0434\u0435\u043d\u0431\u0443\u0440\u0433\u0441\u043a\u0438\u0439 \u0418\u043e\u0430\u0445\u0438\u043c I \u041d\u0435\u0441\u0442\u043e\u0440<\/a> \u0441\u043e \u0432\u0441\u0435\u043c \u0434\u0432\u043e\u0440\u043e\u043c \u0432 \u043f\u0430\u043d\u0438\u043a\u0435 \u043f\u043e\u043a\u0438\u043d\u0443\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D0%BB%D0%B8%D0%BD\" title=\"\u0411\u0435\u0440\u043b\u0438\u043d\">\u0411\u0435\u0440\u043b\u0438\u043d<\/a> \u0438\u0437-\u0437\u0430 \u043b\u043e\u0436\u043d\u044b\u0445 \u0441\u043b\u0443\u0445\u043e\u0432 \u043e \u043d\u0430\u0434\u0432\u0438\u0433\u0430\u044e\u0449\u0435\u043c\u0441\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u043c \u041f\u043e\u0442\u043e\u043f\u0435.<\/li><\/ul><h3>XVIII \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1772_%D0%B3%D0%BE%D0%B4\" title=\"1772 \u0433\u043e\u0434\">1772<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u043f\u0440\u043e\u0448\u043b\u0438 \u043f\u0435\u0440\u0432\u044b\u0435 \u0441\u043a\u0430\u0447\u043a\u0438 \u043f\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D0%BE%D0%B5_%D0%A1%D0%B5%D0%BB%D0%BE\" title=\"\u041a\u0440\u0430\u0441\u043d\u043e\u0435 \u0421\u0435\u043b\u043e\">\u041a\u0440\u0430\u0441\u043d\u044b\u043c \u0421\u0435\u043b\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1783_%D0%B3%D0%BE%D0%B4\" title=\"1783 \u0433\u043e\u0434\">1783<\/a> \u2014 \u0432\u043e \u0424\u0440\u0430\u043d\u0446\u0438\u0438, \u043d\u0430 \u0440\u0435\u043a\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%BD%D0%B0_(%D0%BF%D1%80%D0%B8%D1%82%D0%BE%D0%BA_%D0%A0%D0%BE%D0%BD%D1%8B)\" title=\"\u0421\u043e\u043d\u0430 (\u043f\u0440\u0438\u0442\u043e\u043a \u0420\u043e\u043d\u044b)\">\u0421\u043e\u043d\u0435<\/a>, \u0431\u043b\u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%BE%D0%BD\" title=\"\u041b\u0438\u043e\u043d\">\u041b\u0438\u043e\u043d\u0430<\/a>, \u0438\u043d\u0436\u0435\u043d\u0435\u0440\u043e\u043c-\u0441\u0430\u043c\u043e\u0443\u0447\u043a\u043e\u0439 \u041a\u043b\u043e\u0434\u043e\u043c \u0434\u0435 \u0416\u043e\u0444\u0444\u0440\u0443\u0430 \u0434\u2019\u0410\u0431\u0431\u0430\u043d\u043e\u043c \u0438\u0441\u043f\u044b\u0442\u0430\u043d \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u043f\u0430\u0440\u043e\u0445\u043e\u0434 .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1784_%D0%B3%D0%BE%D0%B4\" title=\"1784 \u0433\u043e\u0434\">1784<\/a>&#160;\u2014 \u043f\u0435\u0440\u0432\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B8%D1%80%D0%B8%D0%B6%D0%B0%D0%B1%D0%BB%D1%8C\" title=\"\u0414\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u044c\">\u0434\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u044c<\/a> \u0441 \u0431\u0430\u043b\u043b\u043e\u043d\u0435\u0442\u043e\u043c (\u043d\u0435\u0431\u043e\u043b\u044c\u0448\u043e\u0439 \u0432\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u0438\u0439 \u0433\u0430\u0437\u043e\u043d\u0435\u043f\u0440\u043e\u043d\u0438\u0446\u0430\u0435\u043c\u044b\u0439 \u043e\u0442\u0441\u0435\u043a, \u043d\u0430\u0445\u043e\u0434\u044f\u0449\u0438\u0439\u0441\u044f \u043c\u0435\u0436\u0434\u0443 \u0433\u0430\u0437\u043e\u0432\u043e\u0439 \u0438 \u0432\u043d\u0435\u0448\u043d\u0435\u0439 \u043e\u0431\u043e\u043b\u043e\u0447\u043a\u043e\u0439, \u0432 \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043c\u043e\u0436\u043d\u043e \u043d\u0430\u043a\u0430\u0447\u0438\u0432\u0430\u0442\u044c \u0432\u043e\u0437\u0434\u0443\u0445 \u0438\u043b\u0438 \u0432\u044b\u043f\u0443\u0441\u043a\u0430\u0442\u044c \u0435\u0433\u043e \u0441 \u0446\u0435\u043b\u044c\u044e \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u044f \u0432\u044b\u0441\u043e\u0442\u043e\u0439 \u043f\u043e\u0434\u044a\u0451\u043c\u0430) \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u043b \u0441\u0432\u043e\u0439 \u043f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u043b\u0451\u0442, \u043e\u043a\u0430\u0437\u0430\u0432\u0448\u0438\u0439\u0441\u044f \u043d\u0435 \u043e\u0447\u0435\u043d\u044c \u0443\u0441\u043f\u0435\u0448\u043d\u044b\u043c: \u044d\u043a\u0438\u043f\u0430\u0436\u0443 \u043f\u0440\u0438\u0448\u043b\u043e\u0441\u044c \u043f\u0440\u043e\u0440\u0435\u0437\u0430\u0442\u044c \u043e\u0431\u043e\u043b\u043e\u0447\u043a\u0443, \u0447\u0442\u043e\u0431\u044b \u0443\u043c\u0435\u043d\u044c\u0448\u0438\u0442\u044c \u0441\u0442\u0430\u0432\u0448\u0435\u0435 \u043e\u043f\u0430\u0441\u043d\u043e \u0432\u044b\u0441\u043e\u043a\u0438\u043c \u0434\u0430\u0432\u043b\u0435\u043d\u0438\u0435 \u0433\u0430\u0437\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1795_%D0%B3%D0%BE%D0%B4\" title=\"1795 \u0433\u043e\u0434\">1795<\/a>&#160;\u2014 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B8%D0%BC%D0%BD_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D0%B8\" title=\"\u0413\u0438\u043c\u043d \u0424\u0440\u0430\u043d\u0446\u0438\u0438\">\u041c\u0430\u0440\u0441\u0435\u043b\u044c\u0435\u0437\u0430<\/a>\u00bb \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e \u0441\u0442\u0430\u043b\u0430 \u0433\u0438\u043c\u043d\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1799_%D0%B3%D0%BE%D0%B4\" title=\"1799 \u0433\u043e\u0434\">1799<\/a>&#160;\u2014 \u0432\u043e \u0432\u0440\u0435\u043c\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B3%D0%B8%D0%BF%D0%B5%D1%82%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D0%BE%D1%85%D0%BE%D0%B4\" title=\"\u0415\u0433\u0438\u043f\u0435\u0442\u0441\u043a\u0438\u0439 \u043f\u043e\u0445\u043e\u0434\">\u0415\u0433\u0438\u043f\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u043f\u043e\u0445\u043e\u0434\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%B