%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0435\u0439<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0435\u0439<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0435\u0439<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D1%83%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u041f\u0440\u0443\u0441\u0441\u0438\u044f\">\u041f\u0440\u0443\u0441\u0441\u0438\u0435\u0439<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u0438\u0435\u0439<\/a>, \u0437\u0430\u043f\u0440\u0435\u0449\u0430\u0432\u0448\u0443\u044e \u043f\u0440\u043e\u0445\u043e\u0434 \u0447\u0435\u0440\u0435\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D1%81%D1%84%D0%BE%D1%80\" title=\"\u0411\u043e\u0441\u0444\u043e\u0440\">\u0411\u043e\u0441\u0444\u043e\u0440<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D1%80%D0%B4%D0%B0%D0%BD%D0%B5%D0%BB%D0%BB%D1%8B\" title=\"\u0414\u0430\u0440\u0434\u0430\u043d\u0435\u043b\u043b\u044b\">\u0414\u0430\u0440\u0434\u0430\u043d\u0435\u043b\u043b\u044b<\/a> \u0432\u043e\u0435\u043d\u043d\u044b\u0445 \u0441\u0443\u0434\u043e\u0432 \u0432\u0441\u0435\u0445 \u0435\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u0445 \u0434\u0435\u0440\u0436\u0430\u0432 \u0431\u0435\u0437 \u0441\u043e\u0433\u043b\u0430\u0441\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D1%80%D1%86%D0%B8%D1%8F\" title=\"\u0422\u0443\u0440\u0446\u0438\u044f\">\u0422\u0443\u0440\u0446\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1852_%D0%B3%D0%BE%D0%B4\" title=\"1852 \u0433\u043e\u0434\">1852<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D0%BB%D1%81%D1%82%D0%BE%D0%B9,_%D0%9B%D0%B5%D0%B2_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0422\u043e\u043b\u0441\u0442\u043e\u0439, \u041b\u0435\u0432 \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u0438\u0447\">\u041b\u0435\u0432 \u0422\u043e\u043b\u0441\u0442\u043e\u0439<\/a> \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%B2%D0%BA%D0%B0%D0%B7\" title=\"\u041a\u0430\u0432\u043a\u0430\u0437\">\u041a\u0430\u0432\u043a\u0430\u0437\u0430<\/a> \u043e\u0442\u043f\u0440\u0430\u0432\u0438\u043b \u0432 \u0436\u0443\u0440\u043d\u0430\u043b \u00ab\u0421\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u0438\u043a\u00bb <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D0%BA%D1%80%D0%B0%D1%81%D0%BE%D0%B2,_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041d\u0435\u043a\u0440\u0430\u0441\u043e\u0432, \u041d\u0438\u043a\u043e\u043b\u0430\u0439 \u0410\u043b\u0435\u043a\u0441\u0435\u0435\u0432\u0438\u0447\">\u041d.&#160;\u0410.&#160;\u041d\u0435\u043a\u0440\u0430\u0441\u043e\u0432\u0443<\/a> \u0441\u0432\u043e\u0451 \u043f\u0435\u0440\u0432\u043e\u0435 \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u0435&#160;\u2014 \u043f\u043e\u0432\u0435\u0441\u0442\u044c \u00ab\u0414\u0435\u0442\u0441\u0442\u0432\u043e\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1865_%D0%B3%D0%BE%D0%B4\" title=\"1865 \u0433\u043e\u0434\">1865<\/a>&#160;\u2014 \u0433\u0430\u0437\u0435\u0442\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D0%B0%D1%8F_%D0%BF%D0%BE%D1%87%D1%82%D0%B0_(%D0%BF%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3%D1%81%D0%BA%D0%B0%D1%8F_%D0%B3%D0%B0%D0%B7%D0%B5%D1%82%D0%B0,_1862%E2%80%941868)\" title=\"\u0421\u0435\u0432\u0435\u0440\u043d\u0430\u044f \u043f\u043e\u0447\u0442\u0430 (\u043f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0441\u043a\u0430\u044f \u0433\u0430\u0437\u0435\u0442\u0430, 1862\u20141868)\">\u0421\u0435\u0432\u0435\u0440\u043d\u0430\u044f \u043f\u043e\u0447\u0442\u0430<\/a>\u00bb \u043e\u043f\u043e\u0432\u0435\u0441\u0442\u0438\u043b\u0430 \u0433\u043e\u0440\u043e\u0436\u0430\u043d \u043e\u0431 \u043e\u0442\u043c\u0435\u043d\u0435 \u0437\u0430\u043f\u0440\u0435\u0442\u0430 \u043d\u0430 \u043a\u0443\u0440\u0435\u043d\u0438\u0435 \u043d\u0430 \u0443\u043b\u0438\u0446\u0430\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1867_%D0%B3%D0%BE%D0%B4\" title=\"1867 \u0433\u043e\u0434\">1867<\/a>&#160;\u2014 \u043d\u0430 \u0441\u0435\u0441\u0441\u0438\u0438 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0439 \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u0438 \u043f\u0440\u043e\u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0438\u0440\u043e\u0432\u0430\u043d\u044b \u043f\u0438\u0441\u044c\u043c\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%81%D0%BA%D0%B0%D0%BB%D1%8C,_%D0%91%D0%BB%D0%B5%D0%B7\" title=\"\u041f\u0430\u0441\u043a\u0430\u043b\u044c, \u0411\u043b\u0435\u0437\">\u041f\u0430\u0441\u043a\u0430\u043b\u044f<\/a> \u044e\u043d\u043e\u043c\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E%D1%82%D0%BE%D0%BD,_%D0%98%D1%81%D0%B0%D0%B0%D0%BA\" title=\"\u041d\u044c\u044e\u0442\u043e\u043d, \u0418\u0441\u0430\u0430\u043a\">\u041d\u044c\u044e\u0442\u043e\u043d\u0443<\/a> \u0441 \u0438\u0437\u043b\u043e\u0436\u0435\u043d\u0438\u0435\u043c \u0437\u0430\u043a\u043e\u043d\u0430 \u0432\u0441\u0435\u043c\u0438\u0440\u043d\u043e\u0433\u043e \u0442\u044f\u0433\u043e\u0442\u0435\u043d\u0438\u044f (\u043f\u043e\u0437\u0436\u0435 \u0432\u044b\u044f\u0441\u043d\u0438\u043b\u043e\u0441\u044c, \u0447\u0442\u043e \u043f\u0438\u0441\u044c\u043c\u0430 \u0431\u044b\u043b\u0438 \u0444\u0430\u043b\u044c\u0448\u0438\u0432\u044b\u043c\u0438).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1869_%D0%B3%D0%BE%D0%B4\" title=\"1869 \u0433\u043e\u0434\">1869<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%9C%D0%B5%D0%B6%D0%B5-%D0%9C%D1%83%D1%80%D1%8C%D0%B5,_%D0%98%D0%BF%D0%BF%D0%BE%D0%BB%D0%B8%D1%82&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u041c\u0435\u0436\u0435-\u041c\u0443\u0440\u044c\u0435, \u0418\u043f\u043f\u043e\u043b\u0438\u0442 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0418\u043f\u043f\u043e\u043b\u0438\u0442 \u041c\u0435\u0436\u0435-\u041c\u0443\u0440\u044c\u0435<\/a> (Hippolyte M\u00e8ge-Mouri\u00e9s) \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%B3%D0%B0%D1%80%D0%B8%D0%BD\" title=\"\u041c\u0430\u0440\u0433\u0430\u0440\u0438\u043d\">\u043c\u0430\u0440\u0433\u0430\u0440\u0438\u043d<\/a> \u0434\u043b\u044f \u043d\u0443\u0436\u0434 \u0432\u043e\u0435\u043d\u043d\u043e-\u043c\u043e\u0440\u0441\u043a\u043e\u0433\u043e \u0444\u043b\u043e\u0442\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1870_%D0%B3%D0%BE%D0%B4\" title=\"1870 \u0433\u043e\u0434\">1870<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u041a\u0430\u043d\u0430\u0434\u0430\">\u041a\u0430\u043d\u0430\u0434\u0443<\/a> \u0432\u043a\u043b\u044e\u0447\u0435\u043d\u044b \u043f\u0440\u043e\u0432\u0438\u043d\u0446\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BD%D0%B8%D1%82%D0%BE%D0%B1%D0%B0\" title=\"\u041c\u0430\u043d\u0438\u0442\u043e\u0431\u0430\">\u041c\u0430\u043d\u0438\u0442\u043e\u0431\u0430<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BE-%D0%97%D0%B0%D0%BF%D0%B0%D0%B4%D0%BD%D1%8B%D0%B5_%D1%82%D0%B5%D1%80%D1%80%D0%B8%D1%82%D0%BE%D1%80%D0%B8%D0%B8\" title=\"\u0421\u0435\u0432\u0435\u0440\u043e-\u0417\u0430\u043f\u0430\u0434\u043d\u044b\u0435 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438\">\u0421\u0435\u0432\u0435\u0440\u043e-\u0417\u0430\u043f\u0430\u0434\u043d\u044b\u0435 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1876_%D0%B3%D0%BE%D0%B4\" title=\"1876 \u0433\u043e\u0434\">1876<\/a>&#160;\u2014 \u043d\u0430 \u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B8%D0%BB%D0%B0%D0%B4%D0%B5%D0%BB%D1%8C%D1%84%D0%B8%D1%8F\" title=\"\u0424\u0438\u043b\u0430\u0434\u0435\u043b\u044c\u0444\u0438\u044f\">\u0424\u0438\u043b\u0430\u0434\u0435\u043b\u044c\u0444\u0438\u0438<\/a> \u043f\u0440\u0438\u043d\u044f\u0442\u043e \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u043e \u0440\u043e\u0441\u043f\u0443\u0441\u043a\u0435 I \u0418\u043d\u0442\u0435\u0440\u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u0430.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1909_%D0%B3%D0%BE%D0%B4\" title=\"1909 \u0433\u043e\u0434\">1909<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u043d\u0433\u043b\u0438\u044f\">\u0410\u043d\u0433\u043b\u0438\u0438<\/a> \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0430 \u0418\u043c\u043f\u0435\u0440\u0441\u043a\u